import Quiz from './quiz';
import Shop from './shop';
import Order from './order';
import Confirmation from './confirmation';

const Navbar = () => {
    return (  
        <div class = "navbar">
            <div class="collapse navbar-collapse" id="navbarText">
            <ul class="navbar-nav mr-auto">
                <li class="nav-item">
                <a class="nav-item" href="App.js">Home</a>
                </li>
                <li class="nav-item">
                <a class="nav-item" href="Shop.js">Shop</a>
                </li>
                <li class="nav-item active">
                <a class="nav-item-active" href="Order.js">Order</a>
                </li>
                <li class="nav-item">
                <a class="nav-item" href="Quiz.js">Coffee Quiz</a>
                </li>
            </ul>
        </div>
      </div>
    );
}

export default Navbar;
